import axios from 'axios';
import React, {useState,useEffect} from 'react';

const Camp=()=>{

    const [camps,setCamps]=useState([]);
    useEffect(()=>{
        const Response=async()=>{
            const {data}=await axios.get("http://127.0.0.1:8000/api/camps/");
            setCamps(data);
        };
        Response();
    },[])

    camps.reverse();
    console.log(camps)
    return (
        <div><h3>nithiesh</h3></div>
    )
};

export default Camp;
